import React, { useState } from 'react';
//import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/LogReg.css'

const RegistrationPage = () => {
    // State for form fields
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [errorMessage, setErrorMessage] = useState('');
    
    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();

        // Basic form validation
        if (!firstName || !lastName || !username || !email || !password || !confirmPassword) {
            setErrorMessage('All fields are required.');
            return;
        }

        // Password validation
        if (password !== confirmPassword) {
            setErrorMessage('Passwords do not match.');
            return;
        }

        // Clear error message and handle form submission logic (e.g., send data to server)
        setErrorMessage('');
        console.log('Registering user:', { firstName, lastName, username, email, password });
        // You can handle API submission or other logic here
    };

    return (
        <div className='background'>
        <div className="d-flex justify-content-center align-items-center vh-100">
            <form onSubmit={handleSubmit} className="bg-white p-4 rounded shadow-sm" style={{ width: '100%', maxWidth: '500px' }}>
                <h2 className="text-center mb-4">Register</h2>

                {errorMessage && <p className="text-danger text-center">{errorMessage}</p>}

                <div className="row mb-3">
                    <div className="col">
                        <label htmlFor="firstName" className="form-label">First Name</label>
                        <input
                            type="text"
                            id="firstName"
                            className="form-control"
                            value={firstName}
                            onChange={(e) => setFirstName(e.target.value)}
                            placeholder="Enter your first name"
                        />
                    </div>
                    <div className="col">
                        <label htmlFor="lastName" className="form-label">Last Name</label>
                        <input
                            type="text"
                            id="lastName"
                            className="form-control"
                            value={lastName}
                            onChange={(e) => setLastName(e.target.value)}
                            placeholder="Enter your last name"
                        />
                    </div>
                </div>

                <div className="mb-3">
                    <label htmlFor="username" className="form-label">Username</label>
                    <input
                        type="text"
                        id="username"
                        className="form-control"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                        placeholder="Choose a username"
                    />
                </div>

                <div className="mb-3">
                    <label htmlFor="email" className="form-label">Email Address</label>
                    <input
                        type="email"
                        id="email"
                        className="form-control"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder="Enter your email address"
                    />
                </div>

                <div className="mb-3">
                    <label htmlFor="password" className="form-label">Password</label>
                    <input
                        type="password"
                        id="password"
                        className="form-control"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder="Create a password"
                    />
                </div>

                <div className="mb-3">
                    <label htmlFor="confirmPassword" className="form-label">Confirm Password</label>
                    <input
                        type="password"
                        id="confirmPassword"
                        className="form-control"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}
                        placeholder="Confirm your password"
                    />
                </div>

                <button type="submit" className="btn btn-primary w-100">Register</button>

                <div className="mt-3 text-center">
                    <p>Already have an account? <a href="/">Login here</a></p>
                </div>
            </form>
        </div>
        </div>
    );
};

export default RegistrationPage;
